			Send(stream.ToArray());
		}

	}
	
	public class BinarySenderStub : BaseBinaryStub
	{
		private ISocket to;
		
		public BinarySenderStub(ISocket to)
		{ this.to = to; }
		
		protected override void Send(byte[] data)
		{
			to.Send(data);
		}
	}
}
